import LoyaltyIcon from '@mui/icons-material/Loyalty';
import DateRangeIcon from '@mui/icons-material/DateRange';
const ProductRightViews = (props) => {
    const data = props.products;
    console.log('rrrrrrrrdata:', data);

    const fassured =
        'https://static-assets-web.flixcart.com/www/linchpin/fk-cp-zion/img/fa_62673a.png';

    return (
        <>
            {data ? (
                <>
                    {' '}
                    <div>
                        <p>{data.title.longTitle}</p>
                        <p
                            style={{
                                marginTop: '-15px',
                                color: '#878787',
                                fontSize: '14px',
                            }}
                        >
                            8 Rating & 1 Reviews
                            <span>
                                <img
                                    src={fassured}
                                    style={{
                                        width: '77px',
                                        marginLeft: '20px',
                                    }}
                                    alt=""
                                />
                            </span>
                            <div>
                                <span style={{ fontSize: '28px' }}>
                                    ₹{data.price.cost}
                                </span>
                                &nbsp; &nbsp;
                                <span>
                                    <strike style={{ color: '#878787' }}>
                                        ₹{data.price.mrp}
                                    </strike>
                                </span>
                                &nbsp; &nbsp;
                                <span style={{ color: 'green' }}>
                                    {data.price.discount} off
                                </span>
                            </div>
                            <div
                                style={{
                                    fontSize: '14px',
                                    marginTop: '10px',
                                    color: 'black',
                                }}
                            >
                                <p>Available offers</p>
                                <p>
                                    <LoyaltyIcon
                                        fontSize="small"
                                        style={{ color: '#00CC00' }}
                                    />{' '}
                                    Bank Offer Get ₹50 instant discount on first
                                    Flipkart UPI transaction on order of ₹200
                                    and aboveT&C
                                </p>{' '}
                                <p>
                                    {' '}
                                    <LoyaltyIcon
                                        fontSize="small"
                                        style={{ color: '#00CC00' }}
                                    />{' '}
                                    Bank Offer 5% Cashback on Flipkart Axis Bank
                                    CardT&C
                                </p>{' '}
                                <p>
                                    {' '}
                                    <LoyaltyIcon
                                        fontSize="small"
                                        style={{ color: '#00CC00' }}
                                    />{' '}
                                    Bank Offer 10% off on ICICI Bank Credit Card
                                    Transactions, up to ₹1000 on orders of
                                    ₹5,000 and aboveT&C
                                </p>{' '}
                                <p>
                                    {' '}
                                    <LoyaltyIcon
                                        fontSize="small"
                                        style={{ color: '#00CC00' }}
                                    />{' '}
                                    Special PriceGet extra 5% off (price
                                    inclusive of cashback/coupon)T&C
                                </p>{' '}
                                <p>
                                    {' '}
                                    <DateRangeIcon
                                        fontSize="small"
                                        style={{ color: '#00CC00' }}
                                    />{' '}
                                    No cost EMI ₹4,764/month. Standard EMI also
                                    availableView Plans
                                </p>
                                <p>
                                    {' '}
                                    <LoyaltyIcon
                                        fontSize="small"
                                        style={{ color: '#00CC00' }}
                                    />{' '}
                                    Bank Offer10% off on ICICI Bank Credit Card
                                    EMI Transactions, up to ₹1250 on orders of
                                    ₹5,000 and aboveT&C
                                </p>
                                <p>
                                    {' '}
                                    <LoyaltyIcon
                                        fontSize="small"
                                        style={{ color: '#00CC00' }}
                                    />{' '}
                                    Bank OfferExtra ₹1000 off on IDFC FIRST Bank
                                    Credit Card EMI Txns on a Net Cart Value of
                                    ₹40,000 and aboveT&C
                                </p>
                                <p>
                                    {' '}
                                    <LoyaltyIcon
                                        fontSize="small"
                                        style={{ color: '#00CC00' }}
                                    />{' '}
                                    Bank OfferExtra ₹750 off on OneCard Credit
                                    Card EMI Transactions on products priced
                                    ₹30,000 and aboveT&C
                                </p>
                                <p>
                                    {' '}
                                    <LoyaltyIcon
                                        fontSize="small"
                                        style={{ color: '#00CC00' }}
                                    />{' '}
                                    Bank OfferExtra ₹750 off on OneCard Credit
                                    Card EMI Transactions on products priced
                                    ₹50,000 and aboveT&C
                                </p>
                                <p>
                                    {' '}
                                    <LoyaltyIcon
                                        fontSize="small"
                                        style={{ color: '#00CC00' }}
                                    />{' '}
                                    Partner OfferMake a purchase and enjoy a
                                    surprise cashback/ coupon that you can
                                    redeem later!Know More
                                </p>
                            </div>
                        </p>
                    </div>
                </>
            ) : (
                <></>
            )}
        </>
    );
};

export default ProductRightViews;
